// src/App.js
import React from 'react';
import Navbar from './components/Navbar';
import Bio from './components/Bio';
import Experience from './components/Experience';
import Projects from './components/Projects';
import './App.css';
import './index.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Hero />
      <Bio />
      <Experience />
      <Projects />
    </div>
  );
}

export default App;
